        _angular_core__WEBPACK_IMPORTED_MODULE_2__["ɵɵtext"](64, "\u0421\u0438\u0442\u0443\u0430\u0446\u0438\u044F \u043C\u0435\u043D\u044F\u0435\u0442\u0441\u044F, \u0435\u0441\u043B\u0438 \u0432 \u0440\u0430\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E \u0442\u0440\u0443\u0434\u043E\u0432\u043E\u0433\u043E \u043A\u043E\u043D\u0444\u043B\u0438\u043A\u0442\u0430 \u0432\u043A\u043B\u044E\u0447\u0430\u0435\u0442\u0441\u044F \u043F\u0440\u043E\u0444\u0441\u043E\u044E\u0437. \u041F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u0439 \u0441\u043E\u044E\u0437, \u0432 \u043A\u043E\u0442\u043E\u0440\u043E\u043C \u0441\u043E\u0441\u0442\u043E\u0438\u0442 \u043C\u043D\u043E\u0436\u0435\u0441\u0442\u0432\u043E \u043D\u0430\u0451\u043C\u043D\u044B\u0445 \u0440\u0430\u0431\u043E\u0442\u043D\u0438\u043A\u043E\u0432, \u0441\u043E\u0437\u0434\u0430\u0451\u0442 \u0435\u0434\u0438\u043D\u0443\u044E \u043E\u0431\u0449\u043D\u043E\u0441\u0442\u044C, \u0433\u043E\u0442\u043E\u0432\u0443\u044E \u0441\u043E\u043F\u0440\u043E\u0442\u0438\u0432\u043B\u044F\u0442\u044C\u0441\u044F \u043B\u044E\u0431\u043E\u043C\u0443 \u043F\u0440\u043E\u0438\u0437\u0432\u043E\u043B\u0443 \u0440\u0430\u0431\u043E\u0442\u043E\u0434\u0430\u0442\u0435\u043B\u044F. \u041F\u0440\u043E\u0444\u0441\u043E\u044E\u0437 \u0431\u0443\u0434\u0435\u0442 \u0437\u0430\u0449\u0438\u0449\u0430\u0442\u044C \u043F\u0440\u0430\u0432\u0430 \u043A\u0430\u0436\u0434\u043E\u0433\u043E \u0447\u043B\u0435\u043D\u0430, \u0442\u043E \u0435\u0441\u0442\u044C \u0432\u0441\u044F \u0441\u0438\u043B\u0430 \u043D\u0430\u0447\u0430\u043B\u044C\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0433\u043E \u00AB\u043E\u0433\u043D\u044F\u00BB \u043F\u0430\u0434\u0435\u0442 \u043D\u0430 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u044E, \u0430 \u043D\u0435 \u043D\u0430 \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u043E\u0433\u043E \u0440\u0430\u0431\u043E\u0442\u043D\u0438\u043A\u0430. \u0417\u0430\u043C\u0435\u0447\u0435\u043D\u043E, \u0447\u0442\u043E \u0441 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u043C\u0438 \u0441\u043E\u044E\u0437\u0430\u043C\u0438 \u043F\u0440\u0435\u0434\u043F\u0440\u0438\u044F\u0442\u0438\u044F \u043D\u0435 \u0440\u0438\u0441\u043A\u0443\u044E\u0442 \u043B\u0438\u0448\u043D\u0438\u0439 \u0440\u0430\u0437 \u0437\u0430\u0442\u0435\u0432\u0430\u0442\u044C \u0442\u044F\u0436\u0431\u0443. \u0420\u0430\u0432\u043D\u043E \u043A\u0430\u043A \u0438 \u0441 \u0438\u0445 \u0447\u043B\u0435\u043D\u0430\u043C\u0438. \u0413\u043B\u0430\u0432\u043D\u0443\u044E \u0440\u043E\u043B\u044C \u0437\u0434\u0435\u0441\u044C \u0438\u0433\u0440\u0430\u0435\u0442 \u0442\u0430 \u0441\u0430\u043C\u0430\u044F \u0441\u043F\u043B\u043E\u0447\u0435\u043D\u043D\u043E\u0441\u0442\u044C \u2013 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u043C\u0443 \u0441\u043E\u044E\u0437\u0443 \u043D\u0435\u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E \u043F\u0440\u0435\u0434\u044A\u044F\u0432\u0438\u0442\u044C \u0432\u044B\u0433\u043E\u0432\u043E\u0440 \u0438\u043B\u0438, \u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0443\u0432\u043E\u043B\u0438\u0442\u044C \u0435\u0433\u043E \u0432 \u0441\u0432\u044F\u0437\u0438 \u0441 \u0438\u0437\u043C\u0435\u043D\u0435\u043D\u0438\u0435\u043C \u0448\u0442\u0430\u0442\u043D\u043E\u0433\u043E \u0440\u0430\u0441\u043F\u0438\u0441\u0430\u043D\u0438\u044F.");
