        _angular_core__WEBPACK_IMPORTED_MODULE_2__["ɵɵtext"](210, "\u041F\u0435\u0440\u0432\u044B\u0439 \u044D\u0442\u0430\u043F - \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435 \u043F\u0435\u0440\u0432\u0438\u0447\u043D\u043E\u0439 \u043F\u0440\u043E\u0444\u0441\u043E\u044E\u0437\u043D\u043E\u0439 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 (\u00AB\u043F\u0435\u0440\u0432\u0438\u0447\u043A\u0430\u00BB, \u041F\u041F\u041E). \u0412 \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E\u043C, \u0435\u0451 \u043C\u043E\u0433\u0443\u0442 \u0443\u0447\u0440\u0435\u0434\u0438\u0442\u044C \u0442\u0440\u0438 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430, \u043A\u0430\u0436\u0434\u044B\u0439 \u0438\u0437 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0441\u0442\u0430\u0440\u0448\u0435 14 \u043B\u0435\u0442, \u0436\u0435\u043B\u0430\u044E\u0449\u0438\u0435 \u0441\u0442\u0430\u0442\u044C \u0447\u043B\u0435\u043D\u0430\u043C\u0438 \u043E\u0431\u0440\u0430\u0437\u043E\u0432\u0430\u043D\u043D\u043E\u0433\u043E \u043F\u0440\u043E\u0444\u0441\u043E\u044E\u0437\u0430. \u041F\u041F\u041E \u0441\u043E\u0437\u0434\u0430\u0451\u0442\u0441\u044F \u0432 \u0445\u043E\u0434\u0435 \u043F\u0435\u0440\u0432\u043E\u0433\u043E \u0441\u043E\u0431\u0440\u0430\u043D\u0438\u044F \u0443\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043B\u0435\u0439. \u041F\u043E\u043C\u0438\u043C\u043E \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u043E \u043F\u0440\u0438\u043D\u044F\u0442\u0438\u044F \u0440\u0435\u0448\u0435\u043D\u0438\u044F \u043E \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0438 \u0446\u0435\u043B\u044C\u044E \u0442\u0430\u043A\u043E\u0433\u043E \u0441\u043E\u0437\u044B\u0432\u0430 \u0431\u0443\u0434\u0435\u0442 \u0438 \u043E\u0431\u0441\u0443\u0436\u0434\u0435\u043D\u0438\u0435 \u043A\u0430\u043D\u0434\u0438\u0434\u0430\u0442\u0443\u0440\u044B \u043F\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043B\u044F \u043F\u0440\u043E\u0444\u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438, \u0432\u044B\u0431\u043E\u0440 \u043A\u043E\u043C\u0438\u0442\u0435\u0442\u0430 \u043F\u0440\u043E\u0444\u0441\u043E\u044E\u0437\u0430 \u0438 \u043F\u0440\u0438\u043D\u044F\u0442\u0438\u044F \u043F\u043E\u043B\u043E\u0436\u0435\u043D\u0438\u044F \u043E \u00AB\u043F\u0435\u0440\u0432\u0438\u0447\u043A\u0435\u00BB.");
