        _angular_core__WEBPACK_IMPORTED_MODULE_2__["ɵɵtext"](212, "\u0420\u0435\u0448\u0435\u043D\u0438\u0435 \u043E\u0431 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 \u041F\u041F\u041E \u043F\u0435\u0440\u0435\u0434\u0430\u0435\u0442\u0441\u044F \u0441\u0442\u043E\u044F\u0449\u0435\u043C\u0443 \u0440\u0430\u043D\u0433\u043E\u043C \u0432\u044B\u0448\u0435 \u043F\u0440\u043E\u0444\u0441\u043E\u044E\u0437\u043D\u043E\u043C\u0443 \u043E\u0440\u0433\u0430\u043D\u0443, \u0437\u0430\u0442\u0435\u043C \u043D\u0430\u0441\u0442\u0443\u043F\u0430\u0435\u0442 \u0447\u0435\u0440\u0451\u0434 \u043F\u043E\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043D\u0438\u044F \u0434\u0430\u043D\u043D\u043E\u0433\u043E \u0440\u0435\u0448\u0435\u043D\u0438\u044F \u043F\u043E \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u043E\u043C\u0443 \u043F\u0440\u0435\u0434\u043F\u0440\u0438\u044F\u0442\u0438\u044E, \u043F\u0435\u0440\u0435\u0432\u043E\u0434\u0435 \u0435\u0433\u043E \u043D\u0430 \u043E\u0431\u0441\u043B\u0443\u0436\u0438\u0432\u0430\u043D\u0438\u0435 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u043C \u0441\u043E\u044E\u0437\u043E\u043C. \u0422\u0430\u043A\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C, \u043A\u0430\u0436\u0434\u0430\u044F \u00AB\u043F\u0435\u0440\u0432\u0438\u0447\u043A\u0430\u00BB \u043F\u043E\u043B\u0443\u0447\u0430\u0435\u0442 \u0434\u0432\u0430 \u0433\u043B\u0430\u0432\u043D\u044B\u0445 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430 \u2013 \u044D\u0442\u043E \u0440\u0435\u0448\u0435\u043D\u0438\u0435 \u0443\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043B\u0435\u0439 \u043E \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0438 \u041F\u041F\u041E \u043F\u043B\u044E\u0441 \u0440\u0435\u0448\u0435\u043D\u0438\u0435, \u043F\u0440\u0438\u043D\u044F\u0442\u043E\u0435 \u0432\u044B\u0441\u0448\u0438\u043C \u043E\u0440\u0433\u0430\u043D\u043E\u043C \u043F\u0440\u043E\u0444\u0441\u043E\u044E\u0437\u0430.");
