        _angular_core__WEBPACK_IMPORTED_MODULE_2__["ɵɵtext"](255, "\u0427\u0442\u043E\u0431\u044B \u0432\u044B\u043F\u043E\u043B\u043D\u0438\u0442\u044C \u043F\u043E\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u043D\u044B\u0435 \u0437\u0430\u0434\u0430\u0447\u0438 (\u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435 \u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u043F\u0435\u0440\u0432\u0438\u0447\u043A\u0438, \u0432\u0435\u0434\u0435\u043D\u0438\u0435 \u043F\u0435\u0440\u0435\u0433\u043E\u0432\u043E\u0440\u043E\u0432 \u0441 \u0430\u0434\u043C\u0438\u043D\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0435\u0439 \u0438 \u0442\u0430\u043A \u0434\u0430\u043B\u0435\u0435) \u0438\u043D\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u043D\u0430\u044F \u0433\u0440\u0443\u043F\u043F\u0430 \u0434\u043E\u043B\u0436\u043D\u0430 \u043F\u0440\u043E\u0432\u0435\u0441\u0442\u0438 \u0441\u0435\u0440\u0438\u044E \u0430\u0433\u0438\u0442\u0430\u0446\u0438\u043E\u043D\u043D\u044B\u0445 \u043C\u0435\u0440\u043E\u043F\u0440\u0438\u044F\u0442\u0438\u0439. \u0421\u043E\u0442\u0440\u0443\u0434\u043D\u0438\u043A\u0430\u043C \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u043E \u0434\u043E\u043D\u0435\u0441\u0442\u0438 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044E \u043E \u0446\u0435\u043B\u044F\u0445 \u043F\u0440\u043E\u0444\u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438. \u0420\u0430\u0441\u0441\u043A\u0430\u0436\u0438\u0442\u0435 \u0438\u043C, \u043A\u0430\u043A \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u0432\u044B\u0448\u0435\u0441\u0442\u043E\u044F\u0449\u0438\u0439 \u043F\u0440\u043E\u0444\u0441\u043E\u044E\u0437, \u0441\u0442\u0430\u0442\u044C \u0447\u043B\u0435\u043D\u0430\u043C\u0438 \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u0432\u044B \u0445\u043E\u0442\u0438\u0442\u0435. \u041E\u0431\u044A\u044F\u0441\u043D\u0438\u0442\u0435 \u0442\u0440\u0443\u0434\u044F\u0449\u0438\u043C\u0441\u044F, \u0447\u0442\u043E \u0442\u0430\u043A\u043E\u0435 \u043A\u043E\u043B\u043B\u0435\u043A\u0442\u0438\u0432\u043D\u044B\u0439 \u0434\u043E\u0433\u043E\u0432\u043E\u0440, \u043A\u0430\u043A\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C \u043E\u043D \u043F\u043E\u043C\u043E\u0433\u0430\u0435\u0442 \u0434\u043E\u0441\u0442\u0438\u0433\u0430\u0442\u044C \u0443\u0432\u0435\u043B\u0438\u0447\u0435\u043D\u0438\u044F \u043E\u043F\u043B\u0430\u0442\u044B, \u0443\u043B\u0443\u0447\u0448\u0435\u043D\u0438\u044F \u043F\u0440\u043E\u0438\u0437\u0432\u043E\u0434\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0445 \u0443\u0441\u043B\u043E\u0432\u0438\u0439, \u043E\u0431\u0435\u0441\u043F\u0435\u0447\u0435\u043D\u0438\u044F \u043A\u0430\u0436\u0434\u043E\u0433\u043E \u0440\u0430\u0431\u043E\u0442\u043D\u0438\u043A\u0430\u043C\u0438 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u043C\u0438 \u0433\u0430\u0440\u0430\u043D\u0442\u0438\u044F\u043C\u0438 \u0438 \u0442.\u043F. ");
