        _angular_core__WEBPACK_IMPORTED_MODULE_2__["ɵɵtext"](270, "\u0415\u0441\u043B\u0438 \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u0438\u043A \u043F\u0440\u0435\u0434\u043F\u0440\u0438\u044F\u0442\u0438\u044F \u043B\u043E\u044F\u043B\u044C\u043D\u043E \u043E\u0442\u043D\u0435\u0441\u0441\u044F \u043A \u043E\u0431\u0440\u0430\u0437\u043E\u0432\u0430\u043D\u0438\u044E \u041F\u041F\u041E \u0438 \u0433\u043E\u0442\u043E\u0432 \u0441\u0442\u0440\u043E\u0438\u0442\u044C \u0441 \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u044B\u043C \u0441\u043E\u044E\u0437\u043E\u043C \u043F\u0430\u0440\u0442\u043D\u0435\u0440\u0441\u043A\u0438\u0435 \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u044F, \u043D\u0435\u0442 \u043D\u0443\u0436\u0434\u044B \u0441\u043A\u0440\u044B\u0432\u0430\u0442\u044C \u043E\u0442 \u043D\u0435\u0433\u043E \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044E. \u0412 \u044D\u0442\u043E\u043C \u0441\u043B\u0443\u0447\u0430\u0435, \u043F\u0440\u043E\u0446\u0435\u0441\u0441 \u043E\u0431\u0440\u0430\u0437\u043E\u0432\u0430\u043D\u0438\u0435 \u043F\u0435\u0440\u0432\u0438\u0447\u043A\u0438 \u0434\u043B\u044F \u0438\u043D\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u043D\u043E\u0439 \u0433\u0440\u0443\u043F\u043F\u044B \u0441\u0438\u043B\u044C\u043D\u043E \u0443\u043F\u0440\u043E\u0449\u0430\u0435\u0442\u0441\u044F. ");
