        _angular_core__WEBPACK_IMPORTED_MODULE_2__["ɵɵtext"](306, "\u0415\u0441\u043B\u0438 \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435 \u043F\u0440\u043E\u0444\u0441\u043E\u044E\u0437\u043D\u043E\u0439 \u043E\u0440\u0433\u0430\u043D\u0438\u0437\u0430\u0446\u0438\u0438 \u043F\u043E-\u043F\u0440\u0435\u0436\u043D\u0435\u043C\u0443 \u043A\u0430\u0436\u0435\u0442\u0441\u044F \u0432\u0430\u043C \u043D\u0435\u043F\u0440\u043E\u0441\u0442\u044B\u043C \u0434\u0435\u043B\u043E\u043C, \u0432\u044B \u0447\u0443\u0432\u0441\u0442\u0432\u0443\u0435\u0442\u0435, \u0447\u0442\u043E \u043D\u0435 \u0441\u043C\u043E\u0436\u0435\u0442\u0435 \u0441\u0430\u043C\u0438 \u0440\u0430\u0437\u043E\u0431\u0440\u0430\u0442\u044C\u0441\u044F \u0432\u043E \u0432\u0441\u0435\u0445 \u044E\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u0430\u0441\u043F\u0435\u043A\u0442\u0430\u0445, \u0438\u043B\u0438 \u043E\u043F\u0430\u0441\u0430\u0435\u0442\u0435\u0441\u044C, \u0447\u0442\u043E \u043F\u043E\u0441\u043B\u0435 \u041F\u041F\u041E \u0440\u0430\u0431\u043E\u0442\u043E\u0434\u0430\u0442\u0435\u043B\u044C \u043C\u043E\u0436\u0435\u0442 \u043D\u0430\u0447\u0430\u0442\u044C \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u0435 \u043D\u0430 \u0432\u0430\u0441 \u0438 \u0432\u0430\u0448\u0438\u0445 \u043A\u043E\u043B\u043B\u0435\u0433 \u2013 \u0432\u0430\u043C \u043C\u043E\u0436\u0435\u0442 \u043F\u043E\u043D\u0430\u0434\u043E\u0431\u0438\u0442\u044C\u0441\u044F \u043F\u043E\u043C\u043E\u0449\u044C.");
